const App = () => {

  return (
    <>
      <header className="container-fluid text-danger text-center bg-light p-3 font-weight-bold"
        style={{ backgroundColor: "#bdc3c7" }}>
        <h1>Welcome To Netflix Official Serious</h1>
      </header>
      <section className="container">
        <div className="row g00">
       
          {
            Sdata.map((val,index) =>{
             return  <Cards 
               key={index}
               img={val.img}
               name={val.name}
               cetagory={val.cetagory}
             />
            })
          }
       
    </div>
      </section>
    
    </>
  )
}

export default App;
